export default function Listbook(props) {
  return (
    <div class="card">
      <ul class="list-group list-group-flush">
        <li class="list-group-item">{props.result}</li>
        <li class="list-group-item">{props.result}</li>
        <li class="list-group-item">{props.result}</li>
      </ul>
    </div>
  );
}
